import React from "react";

const Rentals = () => {
  const gadgets = [
    { id: 1, name: "Laptop", price: "$20/day", features: "8GB RAM, 512GB SSD" },
    { id: 2, name: "Camera", price: "$15/day", features: "DSLR, 4K Video" },
    { id: 3, name: "Gaming Console", price: "$25/day", features: "PlayStation 5, Xbox Series X" },
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-black via-gray-900 to-black text-white p-8">
      <h1 className="text-4xl font-bold text-cyan-400 text-center mb-8">
        Available Rentals
      </h1>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
        {gadgets.map((gadget) => (
          <div
            key={gadget.id}
            className="bg-gradient-to-br from-gray-900 via-black to-gray-800 p-6 rounded-lg shadow-lg hover:shadow-cyan-400/50 text-center"
          >
            <h2 className="text-xl font-bold text-cyan-400">{gadget.name}</h2>
            <p className="text-gray-400 mt-2">{gadget.features}</p>
            <p className="text-cyan-400 font-bold mt-4">{gadget.price}</p>
            <button className="mt-4 px-4 py-2 bg-cyan-400 text-black font-semibold rounded-md hover:bg-cyan-500 transition">
              Rent Now
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Rentals;
